import React from 'react'

const makanan = [
    {
        nama : 'Soto',
        harga : 12000,
    },
    {
        nama : 'Bakso',
        harga : 10000,
    },
    {
        nama : 'Mie ayam',
        harga : 7000,
    }, 
    {
        nama : 'Nasi Goreng',
        harga : 15000,
    },   
]

const Map = () => {
    return (
        <div>
            <h2>Map</h2>
            <ul>
                {makanan.map((makanan, index) =>(
                    <li>{index+1}.{makanan.nama} - Harga {makanan.harga}</li>
                ))}
               
            </ul>
        </div>
    )
}

export default Map
